  return props.trigger ? (
    <ComponentContainer>
      <TextDescription>Your order has been completed</TextDescription>
      <TextDescription>Thank you for but in Amazon Clone</TextDescription>
    </ComponentContainer>
  ) : (
    ""
  );
};

export default Popup;
